function App() {

  return (
    <div>
      <main className="container">
        <h1 className="title">Advice #</h1>
        <p>
          Lorem ipsum, dolor sit amet consectetur adipisicing elit. Quidem.
        </p>
        <picture>
          <source media="(min-width: 768px)" srcSet={pauseDesktop} />
          <img src={pauseMobile} alt="" />
        </picture>
        <button>
          <img src={icon} alt="" />
        </button>
      </main>
    </div>
  );
}

export default App;
